import React from "react";
import { Button } from "mdbreact";

import CreateModal from "./CreateModal";
import { examples } from "./examples";

export default class BlueprintOverview extends React.Component {
    constructor() {
        super();
        this.state = { blueprints: [] };
    }

    componentDidMount() {
        //Here goes a GET call to server for all existing blueprints.
        this.setState({
            blueprints: examples
        });
    }

    render() {
        console.log("BlueprintOverview Component state -> ", this.state);
        //blueprint HTML template
        let blueprintsHtml = this.state.blueprints.map(i => {
            return (
                <div className="each-blueprint" key={i.blueprint_uuid}>
                    <h3>
                        <strong>{i.name}</strong>
                    </h3>
                    <Button color="green">Edit</Button>
                    <Button color="blue">Add Devices</Button>
                    <Button color="red">Remove</Button>
                    <div>
                        <strong>Blueprint Name:</strong> {i.name}
                    </div>
                    <div>
                        <strong>Blueprint UUID:</strong> {i.blueprint_uuid}
                    </div>
                    <div className="capabilities-container">
                        <div className="each-capability">
                            <strong>
                                <p>Commands</p>
                            </strong>
                            {i.commands}
                        </div>
                        <div className="each-capability" />
                        <div className="each-capability" />
                    </div>
                </div>
            );
        }); //close blueprintHtml

        return (
            <div className="blueprint-overview-component">
                <h1>BLUEPRINTS</h1> <h2>MANAGE YOUR DEVICE BLUEPRINTS</h2>
                <CreateModal />
                <div className="blueprints-flex-container">
                    {blueprintsHtml}
                </div>
            </div>
        );
    }
}
